tool validate_range(value: number, min: number, max: number) -> string {
    if value < min {
        return "ERROR: Value " + value + " is below minimum " + min
    } else {
        if value > max {
            return "ERROR: Value " + value + " exceeds maximum " + max
        } else {
            return "OK"
        }
    }
}

